import React from 'react';
import ReactDOM from 'react-dom';
import mapboxgl from 'mapbox-gl';

mapboxgl.accessToken = 'pk.eyJ1IjoiaXNoa3VtYXIiLCJhIjoiY2thN3Fucm10MDZycTJwbzVsZGhkZDZkYyJ9.ZMMsGounuGq3S56MEsEFmw';


class Application extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
        lng: 5,
        lat: 34,
        zoom: 2
        };
        }

        componentDidMount() {
            const map = new mapboxgl.Map({
            container: this.mapContainer,
            style: 'mapbox://styles/ishkumar/ckancssmt0rso1ipdfcc1nih9',
            center: [this.state.lng, this.state.lat],
            zoom: this.state.zoom
            });
            map.fitBounds([[40.2672, 86.1349], [-47.63671875, 52.696361]]);
            map.on('mousemove', function(e) {
                var states = map.queryRenderedFeatures(e.point, {
                  layers: ['tractdata']
                });

                // if (states.length > 0) {
                //   document.getElementById('pd').innerHTML = '<h3><strong>' + states[0].properties.name + '</strong></h3><p><strong><em>' + states[0].properties.density + '</strong> people per square mile</em></p>';
                // } else {
                //   document.getElementById('pd').innerHTML = '<p>Hover over a state!</p>';
                // }
                // console.log("lalal",tra)
              });
            }
            render() {
                return (
                <div>
                <div ref={el => this.mapContainer = el} className="mapContainer" />
                </div>
                )
                }
    }

export default Application;
